import React from 'react';
import Home from './components/Home';
import Navbar from './components/Navbar';
import AboutUs from './components/AboutUs';
import Services from './components/Services';
import Suscribe from './components/Suscribe';
import Destiny from './components/Destiny';
import Productos from './components/Productos';
import Contact from './components/Contact';
import Footer from './components/Footer';
import Terms from './components/Terms';


function App() {

  var infoNacionales=[
    `The Los Altos Beach Resort and Spa is located in Manuel Antonio, Costa Rica. 
    Set on a hillside overlooking the bay, the resort is exquisitely designed 
    and set up on lush and expansive grounds 
    `,
    `Villas Bungalows Ballena has 2 treatment plants to treat wastewater
    Large 80-square-meter pool with terrace, slide and waterfall
    Project with perimeter fences, wide security and restricted access
    We have four bungalow-style villas for 5 to 8 people each
    A bungalow-style villa for 2 to 4 people
    Kid's play zone
    Parking for 8 vehicles
    Wireless internet
    2 BBQ ranches
    `,
    `Hotel Boutique Le Caméléon offers beach accommodation in the tropical forest of Puerto Viejo, Limón. 
    The 23 rooms are located around the pool and surrounded by lush tropical gardens. Our white rooms are minimalist 
    in style and decorated with brightly colored brush strokes.`,
    `Selina La Fortuna is located in the center of town and is the perfect starting point for all your adventures.
     Stay in our private rooms, suites, and more. Here you will feel at home, while meeting travellers from all around 
     for the same great experience.`
  ];

  var InfoNacionalPrices=[
    `$470 for night`,`$122 for night`,`270$ for night`,
    `77$ for night`,`136$ for night`
  ];

  var images=["portfolio-5.jpg","portfolio-4.jpg","portfolio-3.jpg","portfolio-2.jpg","portfolio-1.jpg"];

  return (
    <div className="App">
      <body>
        <Home />
        <Navbar />
        <AboutUs />
        <Services />
        <Suscribe />
        <Destiny title={"Costa Rica's Hotels"} images={["portfolio-5.jpg","portfolio-4.jpg","portfolio-3.jpg","portfolio-2.jpg","portfolio-1.jpg"]}
        names={["Occidental Tamarindo","Selina","Le Cameleon ","Villas Nicolas","Bungalows Ballena"]} infoNacionales={infoNacionales} InfoNacionalPrices={InfoNacionalPrices}/>
        <Destiny title={"International Hotels"} images={["portfolio-6.jpg","portfolio-7.jpg","portfolio-8.jpg","portfolio-9.jpg","portfolio-10.jpg"]}
        names={["Mitsui Garden Hotel Gotanda","Barcelo Bavaro Palace","Icon","Almanac","The Westin Resort"]}/>
        <Productos title={"National Travels"}/>
        <Productos title={"International Travels"}/>
         <Terms/>
        <Contact />
        <Footer />

      </body>
    </div>
  );
}

export default App;
